export const Logo = () => {
  return (
    <img className="logo"
      src="https://global-uploads.webflow.com/62e8d2ea218fb7676b6892a6/63a9a311ecd826aa5be44d4e_NS%20Logo%20primary%20white-p-500.png"
      alt="Amazon music logo"
    />
  );
};
